import axios from "axios";

export async function deleteData(id) {
  return axios.delete(
    process.env.REACT_APP_BACKEND_PORT + "/api/comment/delete/" + id
  );
}

export async function updateRating(id, text, rating = 0) {
  return axios.put(
    process.env.REACT_APP_BACKEND_PORT + "/api/comment/update/" + id,
    {
      comment_text: text,
      comment_rating: rating,
    }
  );
}

export default { updateRating, deleteData };
